import React from 'react'

function Skill(props) {
    console.log(props);
    return (
        <div className="Skill" id={props.id}>
            <img className="SkillIcon" src={props.src} />
            <div className="SkillBar"></div>
            <li></li>
        </div>
    )
}

export default Skill
